    def accept_file(self):
        import os
        stl_list = []
        for i in range(self.tableWidget.rowCount()):
            roots = self.tableWidget.cellWidget(i,0).text()
            if roots.endswith('.py'):
                stl_list.append(roots)
        self.tableWidget_2.setRowCount(len(stl_list))
        self.tableWidget_2.setColumnCount(5)
        self.tableWidget_3.setRowCount(len(stl_list))
        self.tableWidget_3.setColumnCount(5)

        for j, root in enumerate(stl_list):            
            file_name = os.path.basename(root)
            file_name = file_name.split('.')[0]
            self.accept_file_label = QtWidgets.QLabel()
            self.accept_file_label.setText(file_name)
            self.accept_file_lineedit = QtWidgets.QLineEdit()
            self.accept_file_lineedit.setText('(1 1)')
            self.faceZone = QtWidgets.QLineEdit()
            self.faceZone.setText(file_name)
            self.cellZone = QtWidgets.QLineEdit()
            self.cellZone.setText(file_name)
            self.cellZoneInside = QtWidgets.QComboBox()
            self.cellZoneInside.addItem('inside')
            self.cellZoneInside.addItem('outside')
            self.tableWidget_2.setHorizontalHeaderLabels(['模型名称','level','faceZone','cellZone','cellZoneInside'])
