    def get_layout_res(self,Layout):
        label_list = []
        res_list = []
        wiget_type = Layout.itemAt(i).widget().__class__.__name__
        for i in range(Layout.count()):
            if  wiget_type == 'QLabel':
                label_list.append(Layout.itemAt(i).widget().text()) 
            if wiget_type == 'QLineEdit':
                res_list.append(Layout.itemAt(i).widget().text())
            if wiget_type == 'QComboBox':
                res_list.append(Layout.itemAt(i).widget().currentText())  
        return label_list , res_list

